import React from "react";

function Project(){
    return (
        <div className="bg-[#393053] flex flex-col justify-center">
            <div className="flex justify-center">
                <h2 className="text-[35px] lg:text-[45px] text-white m-3">Projects</h2>
            </div>

        </div>
    );
}

export default Project;
